import React from "react";
import { pressButton } from "./app/action-creators/pressButton";
import { connect } from "react-redux";
import { bindActionCreators } from "redux";

function Button(props) {
        return (
            <button key={props.value} onClick={() => props.pressButton(props.value)}>{props.value}</button>
        )
}

function mapStateToProps(state) {
    return {
        firstVal: state.firstVal, 
        op: state.op, 
        secondVal: state.secondVal, 
        isFirst: state.isFirst
    }
}

function matchDispatchToProps(dispatch) {
    return bindActionCreators({pressButton: pressButton}, dispatch)
}

export default connect(mapStateToProps, matchDispatchToProps)(Button);
